import { BrowserRouter as Router, Routes, Route, Link, withRouter } from 'react-router-dom'

// page & layouts imports
import HomePage from './pages/HomePage'
import StoreFront from './pages/StoreFront'
import SingleProduct from './pages/SingleProduct'
import Category from './pages/Category'

function App() {
  return (
    <Router>
      <nav>
        <Link to="/">Home</Link> |{" "}
        <Link to="store">Store</Link>
      </nav>
      <Routes>
        <Route exact path="/" element={withRouter(<HomePage />)}>
          <Route path="store" element={withRouter(<StoreFront />)} />
          <Route path=":slug" element={withRouter(<Category />)} />
          <Route path=":slug" element={withRouter(<SingleProduct />)} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
